import MetaMain1 from "../images/metaSai/Alpha-star.png";
import MetaMain2 from "../images/metaSai/forecast.png";
import MetaMain3 from "../images/metaSai/D-univ.jpg";
import MetaMain4 from "../images/metaSai/Cheer-up.jpg";
import MetaMain5 from "../images/metaSai/Saas.jpg";




const dataCard = [
  {
    id: 1,
    img: MetaMain1,
    title: "Alpha-star"
  },
  {
    id: 2,
    img: MetaMain2,
    title: "forecast"
  },
  {
    id: 3,
    img: MetaMain3,
    title: "D-Univ."
  },
  {
    id: 4,
    img: MetaMain4,
    title: "Cheer-up"
  },
  {
    id: 5,
    img: MetaMain5,
    title: "Saas"
  },
];

export default dataCard;
